import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useNavigate,
} from "react-router-dom";
import Signup from "./pages/Signup";
import Login from "./pages/Login";
import UserDashboard from "./pages/UserDashboard";
import OwnerDashboard from "./pages/OwnerDashboard";
import AdminDashboard from "./pages/AdminDashboard";
import axios from "axios";
import "./App.css";

function Navbar({ user, setUser }) {
  const [dropdownOpen, setDropdownOpen] = useState(false);
  const [newPassword, setNewPassword] = useState("");
  const [message, setMessage] = useState("");
  const navigate = useNavigate();

  const handleLogout = () => {
    setUser(null);
    navigate("/login");
  };

  const handleChangePassword = async () => {
    if (!newPassword) return;
    try {
      await axios.put("http://localhost:8080/change-password", {
        user_id: user.user_id,
        password: newPassword,
      });
      setMessage("Password updated successfully!");
      setNewPassword("");
      setDropdownOpen(false);
    } catch (err) {
      setMessage(err.response?.data?.error || "Error updating password");
    }
  };

  return (
    <nav className="navbar">
      <div className="nav-logo">Suyog Ratings App</div>
      <div className="nav-links">
        {!user ? (
          <>
            <Link to="/signup">Signup</Link>
            <Link to="/login">Login</Link>
          </>
        ) : (
          <div className="profile-container">
            <img
              src="https://cdn-icons-png.flaticon.com/512/3135/3135715.png"
              alt="Profile"
              className="profile-logo"
              onClick={() => setDropdownOpen(!dropdownOpen)}
            />
            {dropdownOpen && (
              <div className="profile-dropdown animate-fadeIn">
                <p>
                  <b>{user.username}</b>
                </p>
                <input
                  type="password"
                  placeholder="New Password"
                  value={newPassword}
                  onChange={(e) => setNewPassword(e.target.value)}
                  style={{
                    padding: "6px",
                    borderRadius: "5px",
                    border: "1px solid #ccc",
                  }}
                />
                <button
                  onClick={handleChangePassword}
                  className="logout-btn"
                  style={{ backgroundColor: "#007bff" }}
                >
                  Update Password
                </button>
                <button onClick={handleLogout} className="logout-btn">
                  Logout
                </button>
                {message && (
                  <p style={{ color: "green", marginTop: "5px" }}>{message}</p>
                )}
              </div>
            )}
          </div>
        )}
      </div>
    </nav>
  );
}

function App() {
  const [user, setUser] = useState(null);

  return (
    <Router>
      <div className="app-container">
        <Navbar user={user} setUser={setUser} />
        <main className="page-content animate-fadeIn">
          <Routes>
            <Route path="/signup" element={<Signup />} />
            <Route path="/login" element={<Login setUser={setUser} />} />
            <Route
              path="/user-dashboard"
              element={<UserDashboard user={user} />}
            />
            <Route
              path="/owner-dashboard"
              element={<OwnerDashboard user={user} />}
            />
            <Route
              path="/admin-dashboard"
              element={<AdminDashboard user={user} />}
            />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
